import React, {Component} from 'react'
import DogInfo from './DogInfo'

const SummaryContainer = ({displayPup}) => {
    return(
        <div id='dog-summary-container'>
            <h1>DOGGO:</h1>
            <DogInfo displayPup={displayPup}/>
        </div>
    )
}

export default SummaryContainer
